Registration Requirement is as below:
1-Referral Challenge/ Team Competition/ Individual Competition:
*Ensure at least 100 BUSD balance in your USD‚ì?M Futures wallet or open Multi-Asset Mode;
*Participating Binance accounts have to be Verified‚Ä? Please register here if you do not have a Binance Account;
1-Broker Solo Competition:
*Submit your registration request to any of our twelve Tournament Broker Partners first and then trade at least 10,000 BUSD or equivalent in any Futures contracts.

Notes on referrals:

If your referral is new to Binance or their accounts are not yet verified, you will only receive Referral Challenge Points when their accounts are verified;

Verification usually takes several days after necessary documents are submitted.

Mechanism B.1: Team Competition - Break Your Team Record to Share 1,200,000 BUSD!

All teams trading Coin-M and USD‚ì?M contracts on Binance Futures during the competition period will be ranked based on their total sum of Team Daily PNL. Team Daily PNL is the sum of top 10 eligible team members‚Ä?PNL. Please note that:

* Profit from BUSD Futures contracts will be multiplied by a coefficient of 2 when calculating the individual Profit for the tournament;

* Profit from BUSD Futures contracts of NFT Holder will be multiplied by a coefficient of 3 when calculating the individual Profit for the tournament;

*An eligible user is a user whose daily trading volume >=$30,000;

*If less than 10 team members meet the above criterion, the daily PNL of all eligible members will be recorded.

Notes for Team Leader:(Optional, depends on the length of the snapshot)

* In addition to the prizes, winning Team Leaders may receive publicity exposure from Binance;

* There is no limit on the size of each team;

* Once your team is created, you will not be able to make any further changes unless it‚Äôs below 10 members after 2021-12-07 00:00 AM (UTC). You can raise a Customer Support request to disband your team after 2021-12-07 00:00 AM (UTC). After the team is disbanded, you and your members will be free to join other teams;

 * You will be able to continue adding team members after the Competition Period starts;

* Use your team referral link to invite people to join your team and record them as your referrals; existing Binance Futures users who join your team without using your referral link will not be recorded as your referrals;
* After registration, the team leaders will be automatically added into the Team Chat Room. During the competition period, team leaders can use the Team Chat Room to review team performance and provide guidance on how to trade on Binance Futures;

* Please note that the analysis provided by team leaders is not representative of the views of Binance in any way. Binance will not be held liable for any trading losses experienced by team members following guidance from team leaders.

Notes for Team Member:(Optional, depends on the length of the snapshot)

Team Members can choose to join their favorite team from the Futures Grand Tournament landing page;

* Team Members will not be able to change teams after joining unless the team fails to reach 10 members and the Team Leader decides to disband the team;

* Team Members can join any team at any point during the competition period;

* Use your team referral link to invite people to join your team and record them as your referrals; existing Binance Futures users who join your team without using your referral link will not be recorded as your referrals;

* After registration, team members will be automatically added into the Team Chat Room.

Mechanism B.2: Individual Competition - Daily ROI Rewards to Be Won!

All Individual Competition participants with a minimum total trading volume of 10,000 BUSD across Coin-M and USD‚ì?M contracts on Binance Futures during the competition period will be ranked based on their daily ROI. There are a total of 15 qualifying periods, starting at 2021-12-10 00:00 (UTC), and each qualifying period will run for 24 hours. Please note that:

* Each Individual Daily Prize Pool is one fifteenth of the Total Individual Prize Pool;

* Profit from BUSD Futures contracts will be multiplied by a coefficient of 2 when calculating the daily ROI for each run;

* Profit from BUSD Futures contracts of NFT Holder will be multiplied by a coefficient of 3 when calculating the daily ROI for each run.

[Pass]Terms and Conditions:

* All Binance users must have their account Verified‚Ä?before registering for the tournament. Please register here if you do not have a Binance Account;

* Sub-accounts will not be considered as individual participants. PNL and trading volume of sub-accounts will be combined with the master accounts‚Ä?standard PNL and trading volume in the final calculation;

* All Coin-M and USD‚ì?M trading pairs are included in this tournament;

* The effective trading volume counts both buys and sells, excluding any wash trades;

* The trading volume of non-BUSD margined contracts will be calculated in BUSD based on the daily exchange rate;

* Users can win multiple prizes as long as they meet the relevant terms and conditions;

* Each day refers to 00:00 AM to 00:00 AM on the next day (UTC);

* Leaderboard ranks and results will be updated each day at 03:00 AM (UTC);

* Binance reserves the right to mint an addition of 100 NFTs to reward community members;

* Binance reserves the right to disqualify trades that are deemed to be wash trades, illegal bulk account registrations, self-dealing, or display signs of market manipulation, etc.;

* Binance reserves the right at any time in its sole and absolute discretion to determine and/or amend or vary these terms and conditions without prior notice, including but not limited to canceling, extending, terminating, or suspending this promotion, the eligibility terms and criteria, the selection and number of winners, and the timing of any act to be done, and all Participants shall be bound by these amendments;

* Where any discrepancy arises between the translated versions and the original English version, the English version shall prevail.

